import React from "react";
import './JobHistory.css';

export default () => {
  return (
    <div className="component third-component">
      <div className="contentJobHistory">
        <h1>Job history</h1>
        <div className="infoTable infoTable--2cols" >
            <div className="infoTable-cell"><h3>Telstra in Brisbane City: </h3></div>
            <div className="infoTable-cell">As an intern for the winter break in 2017 (Month of July) in the position of Automation Specialist. This was awarded to me through the Stepping Into program run by the Australian Network on Disability (AND).</div>

            <div className="infoTable-cell"><h3>Body Corporate at Food Works Scarness, Hervey Bay: </h3></div>
            <div className="infoTable-cell">From April 2011 to December 2012.</div>

            <div className="infoTable-cell"><h3>Smithies Pizzeria on the Esplanade in Scarness, Hervey Bay: </h3></div>
            <div className="infoTable-cell">From August 2012 to March 2013.</div>
          </div>
      </div>
    </div>
  );
};
